  JWILLIAMS, William Athol (Bill) and BATHGATE, Vivienne Cecilia
  WILLIAMS, William Athol (Bill) and BATHGATE, Vivienne Cecilia (cont...)
  farmer on "Te Aute" then served in the 16th New Zealand Field Regiment in Korea. On his return he
  farmed on "Netherton" until his retirement. He was secretary of the H & W Williams Trust until June
  1997. He is a member of the Waipu Synod, the Waipu Diocesan Standing Committee and the Board of
  Nominations General Synod.
  Vivienne is a marriage guidance counsellor and an industrial chaplain.
  01> WILLIAMS, Stephen William
  b 31.12.1954 d 17.01.1955
  Stephen bd, at Pukehou Cemetery.
  02> WILLIAMS, Kimble Charles
  b 15.05.1957
  Address: 113 Norris Road, Rothwell, Qid 4022, Australia.
  Kimble was educated at Hereworth School and Wanganui Collegiate School and completed an
  instrumental engineering apprenticeship with Paykel Honeywell. He has worked in England and Saudi
  Arabia and is now in Brisbane.
  03> WILLIAMS, Andrew William m on 20.02.1993 to CONNOLLY, Joanne Elizabeth
  b 20.03.1959
  b 16.02.1958
  Andrew m, at Pukehou. Joanne, d/o Melville Martin Connolly and Ann Mary Leslie, b. at Mangakino.
  Address: 13 Rakau Road, Hataitai, Wellington.
  Andrew was educated at Hereworth School and Wanganui Collegiate School. He worked at Invermay
  Research Station and completed a National Certificate of Business Studies at Wellington Polytech.
  Joanne is a secretary with a Wellington law firm,
  04> WILLIAMS, William Hamilton
  b 05.11.1962 d 04.06.1981
  William bd, at Pukehou Cemetery. William was educated at Hereworth School and Wanganui Collegiate
  School where he was a school prefect, captain of athletics, and was awarded an "A" bursary. He was
  training with the Royal Green Jackets in Winchester, England when he was drowned in a training
  accident.
  04>' WILLIAMS, Charles Athol m on 04.07.1979 to (2)WILLIS, Genevra
  b 23.01.1899 d 03.08.1990
  b 17.10.1909 d **.06.1995
  Athol m., at Titoki, Bay of Plenty and d. at Havelock North.
  Genevra was a nurse whose experience led her to a particular vocation in the healing ministry, first to
  join the staff of Burrswood Home of Healing at Kent, England and later to be a foundation staff member of
  Titoki Healing Centre near Whakatane. It was from there that she and Athol were married.
  64> WILLIAMS, Thomas Leonard
  b 04.01.1858 d 09.04.1880
  Leonard b. and d, at Te Aute. He suffered illness for most of his life.
  05> WILLIAMS, Francis Henry
  b 26.03.1859 d 17.11.1963
  Francis b, and d. at Te Aute.
